import ExpensItem from './ExpenseItem'


const Expenses = (props) =>{

    return <div>
       return {props.items.map((expense)=>{
            <ExpensItem title = {expense.title}
                        amount = {expense.amount}
                        date = {expense.date} />
        })}
    </div> ;
}

export default Expenses ;
